import { Navigate, useRoutes } from 'react-router-dom';
// layouts
import DashboardLayout from './layouts/dashboard';
import SimpleLayout from './layouts/simple';
//
import BlogPage from './pages/BlogPage';
import UserPage from './pages/UserPage';
import LoginPage from './pages/LoginPage';
import Page404 from './pages/Page404';
import ProductsPage from './pages/ProductsPage';
import DashboardAppPage from './pages/DashboardAppPage';

// ----------------------------------------------------------------------

export default function Router() {
  const routes = useRoutes([
    {
      path: '/front/dashboard',
      element: <DashboardLayout />,
      children: [
        { element: <Navigate to="/front/dashboard/app" />, index: true },
        { path: 'front/app', element: <DashboardAppPage /> },
        { path: 'front/user', element: <UserPage /> },
        { path: 'front/products', element: <ProductsPage /> },
        { path: 'front/blog', element: <BlogPage /> },
      ],
    },
    {
      path: 'front/login',
      element: <LoginPage />,
    },
    {
      element: <SimpleLayout />,
      children: [
        { element: <Navigate to="/front/dashboard/app" />, index: true },
        { path: 'front/404', element: <Page404 /> },
        { path: '*', element: <Navigate to="/front/404" /> },
      ],
    },
    {
      path: '*',
      element: <Navigate to="/front/404" replace />,
    },
  ]);

  return routes;
}
